import React from 'react';
import ReactDOM from 'react-dom';
import "./SpProfeTrain.css";
import {getPortDataClass} from '../../../Method.js';
//实例化方法
const getPortData = new getPortDataClass();

export default class SpProfeTrain extends React.Component {
    constructor(props) {
        super(props);
        this.state={
            "cumTrain":'',
            "passRate":''
        }
        this.timer='';//定时器
    }

    componentDidMount() {
//        数据
//         var _this = this;

        //获取数据,画图，渲染
        getPortData.getUrlData(getRoot.SpecificTrainProfession,(data)=>{
            // console.log("我是专业训练数据",data);
            //累计人数  合格率
            this.setState({
                "cumTrain":data["totalRate"]["totalTrainNum"],
                "passRate":data["totalRate"]["trainPassRate"]
            })
            //图表
            let splitArr=this.splitArray(data["barChart"],data["barChart"].length/2);
            let SpData;
            let dataIndex = 0;
            SpData = this.SpGroupData(splitArr[dataIndex]);
            this.drawSpBar(SpData);
            //    动态效果
            clearInterval(this.timer);
            this.timer = setInterval(()=>{
                dataIndex++;
                SpData = this.SpGroupData(splitArr[dataIndex % 2]);
                this.drawSpBar(SpData);
            }, timeCycle.SpecificTrainProfession);
        });
    }

    componentWillUnmount() {
        clearInterval(this.timer);
    }
    //一个数组分为几个小数组(arr=>需要拆分的数组,len=>每个小数组的length)
    splitArray(arr, len) {
        let a_len = arr.length;
        let result = [];
        for (let i = 0; i < a_len; i += len) {
            result.push(arr.slice(i, i + len));
        }
        return result;
    }
    //每次渲染的图表数据
    SpGroupData(data) {
        let trainData = [],//柱状图data数据
            trainDec = [],//柱状图markPoint数据
             trainSpe=[];//x轴数据
        let retData={}
        for (let i = 0; i < data.length; i++) {
            trainData.push({
                "name": data[i]["name"],
                "value": data[i]["value"]
            });
            trainDec.push({
                "coord":[i,data[i]["value"]]
            });
            trainSpe.push(data[i]["name"]);
        }
        return  retData= {
                 "trainData": trainData,
                 "trainDec": trainDec,
                 "trainSpe": trainSpe
                };
    }
    //画图
    drawSpBar(SpData) {

        var barxunSrc = "data:image/png;base64,";
        var piePatternImg = new Image();
        piePatternImg.src = barxunSrc;
        let SpProfeTrainG3 = G3("SpProfeTrain-bar");
        SpProfeTrainG3.getData("../../../../Public/data/json/Chart/chartData.json", "Bar").drawChart(
            {
                "title": {
                    "text": null
                },
                tooltip: {
                    trigger: 'axis',
                    "formatter": function (params) {
                        // console.log(para);
                        return params[0]["data"]["name"] + ":" + params[0]["data"]["value"];
                    },
                    axisPointer: {            // 坐标轴指示器，坐标轴触发有效
                        type: 'none'        // 默认为直线，可选为：'line' | 'shadow'
                    }
                },
                grid: {
                    bottom: '0%',
                    top: '2%',
                    left:'2%',
                    right:'2%'
                },
                "xAxis": [
                    {
                        "type": "category",
                        "show": false,
                        "axisLabel": {
                            "color": "#8a8d95",

                        },
                        "data": ["警务指挥", "政工", "警务保障", "纪检监察",
                            "警务督察", "国保", "经侦", "治安", "刑侦", "禁毒",
                            "出入境管理"],
                        "axisLine": {
                            show: false
                        },
                        "axisTick": {
                            show: false,
                            "alignWithLabel": true
                        }
                    },
                    {
                        "type": "category",
                        "position": "bottom",
                        "axisLabel": {
                            "color": "#8a8d95",
                            "fontSize": 12
                        },
                        "data": SpData.trainSpe,
                        "axisLine": {
                            show: false
                        },
                        "axisTick": {
                            show: false,
                            "alignWithLabel": true
                        }
                    }
                ],
                "yAxis": [{
                    "splitNumber": 4,
                    "axisLabel": {
                        "color": "#8a8d95",
                        "fontSize": 12
                    },
                    "axisTick": {
                        show: false
                    },
                    "axisLine": {
                        show: false
                    },
                    "splitLine": {
                        lineStyle: {
                            color: {
                                type: 'linear',
                                x: 1,
                                y: 0,
                                x2: 0,
                                y2: 0,
                                colorStops: [{
                                    offset: 0, color: "rgba(130,27,254,1)" // 0% 处的颜色
                                }, {
                                    offset: 1, color: "rgba(11,34,111,0.8)" // 100% 处的颜色
                                }],
                                globalCoord: false // 缺省为 false
                            },
                            type: "dashed"
                        }
                    },
                }],
                "series": [
                    {
                        name: '渐变背景',
                        type: 'bar',
                        barWidth: '60%',
//                            stack:"训练",
                        itemStyle: {
                            normal: {
                                color: {
                                    type: 'linear',
                                    x: 0,
                                    y: 1,
                                    x2: 0,
                                    y2: 0,
                                    colorStops: [{
                                        offset: 0, color: "rgba(0,219,150,0.1)" // 0% 处的颜色
                                    }, {
                                        offset: 1, color: "rgba(0,219,150,0.5)" // 100% 处的颜色
                                    }],
                                    globalCoord: false // 缺省为 false
                                }
//                                    opacity:0.5
                            }
                        },
                        barGap: "-100%",
                        // data: [20, 520, 200, 334, 390, 330, 220, 20, 520, 200, 334, 390, 330]
                        data: SpData.trainData
                    },
                    {
                        name: '条纹',
                        type: 'bar',
                        barWidth: '60%',
                        stack: "训练",
                        itemStyle: {
                            normal: {
                                color: {
                                    image: piePatternImg,
                                    repeat: 'no-repeat',
                                },
                                opacity: 0.5
                            }
                        },
                        // data: [20, 520, 200, 334, 390, 330, 220, 20, 520, 200, 334, 390, 330]
                        data: SpData.trainData,
                        markPoint:{
                            symbol:"rect",
                            symbolSize:[45.5,5],
                            itemStyle:{
                                normal:{
                                    color: {
                                        type: 'linear',
                                        x: 1,
                                        y: 0,
                                        x2: 0,
                                        y2: 0,
                                        colorStops: [{
                                            offset: 0, color: '#00fdfe' // 0% 处的颜色
                                        }, {
                                            offset: 1, color: '#0072ba' // 100% 处的颜色
                                        }],
                                        globalCoord: false // 缺省为 false
                                    },
                                }
                            },
                            label:{
                                normal:{
                                    show:false
                                }
                            },
                            data:SpData.trainDec
                            /*[
                                {coord:[0,10]},
                                {coord:[1,52]}
                            ]*/
                        },
                    }
                ]
            });
    }

    render() {
        return (
            <div className="SpProfeTrain">
                {/*专业训练标题*/}
                <div className="SpProfeTrain-title">
                    专业训练
                </div>
                {/*专业训练文字人数*/}
                <div className="SpProfeTrain-word">
                    <ul className="clear">
                        <li className="clear cumTrain">
                            <span>累计训练人数</span>
                            <span>|</span>
                            <span className="trainNum">{this.state.cumTrain}人</span>
                        </li>
                        <li className="clear passRate">
                            <span>合格率</span>
                            <span>|</span>
                            <span className="trainPre">{this.state.passRate}%</span>
                        </li>
                    </ul>
                </div>
                {/*专业训练图表*/}
                <div id="SpProfeTrain-bar"></div>
            </div>
        )

    }
}
